import React from 'react';
import { mdiBriefcase, mdiFolder } from '@mdi/js';
import Icon from '@mdi/react';

const Portfolio = () => {
  return (
    <>

      <section className="portfolio-section">
        <div className="portfolio-content">
          <div className="portfolio-text">
            <h1 style={{ color: 'white' ,fontSize: '3rem'}}>Our Portfolio</h1>
            <p className="section-subtitle" style={{ color: 'white' }}>Showcasing Our Best Projects</p>
          </div>
          <div className="portfolio-cards">
            <div className="portfolio-card">
              <Icon path={mdiBriefcase} size={2} color="white" />
              <h2 style={{ color: 'white' }}>Project 1: Mobile App Development</h2>
              <p style={{ color: 'white' }}>
                We designed and developed a mobile app for a leading e-commerce company, resulting in a 30% increase in sales.
              </p>
              <ul style={{ color: 'white' }}>
                <li>Native App Development</li>
                <li>Cross-Platform App Development</li>
                <li>App Maintenance and Updates</li>
              </ul>
              <button style={{ backgroundColor: '#01224a', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '10px' }}>View Case Study</button>
            </div>
            <div className="portfolio-card">
              <Icon path={mdiFolder} size={2} color="white" />
              <h2 style={{ color: 'white' }}>Project 2: Web Development</h2>
              <p style={{ color: 'white' }}>
                We built a custom website for a startup, resulting in a 50% increase in website traffic.
              </p>
              <ul style={{ color: 'white' }}>
                <li>Custom Website Development</li>
                <li>E-commerce Website Development</li>
                <li>Web Application Development</li>
              </ul>
              <button style={{ backgroundColor: '#01224a', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '10px' }}>View Case Study</button>
            </div>
            {/* <div className="portfolio-card">
              <Icon path={mdiBriefcase} size={2} color="white" />
              <h2 style={{ color: 'white' }}>Project 3: Mobile App Development</h2>
              <p style={{ color: 'white' }}>
                We designed and developed a mobile app for a leading healthcare company, resulting in a 25% increase in patient engagement.
              </p>
              <ul style={{ color: 'white' }}>
                <li>Native App Development</li>
                <li>Cross-Platform App Development</li>
                <li>App Maintenance and Updates</li>
              </ul>
              <button style={{ backgroundColor: '#01224a', color: 'white', border: 'none', padding: '10px 20px', borderRadius: '10px' }}>View Case Study</button>
            </div> */}
          </div>
        </div>
      </section>

      <style jsx>{`
        .portfolio-section {
          padding: 100px 0;
          background-color: #00183d; 
        }

        .portfolio-content {
          max-width: 1200px;
          margin: 0 auto;
          padding: 0 20px;
        }

        .portfolio-text {
          margin-bottom: 40px;
          text-align: center;
        }

        .portfolio-cards {
          display: flex;
          flex-wrap: wrap;
          justify-content: center;
        }

        .portfolio-card {
          background-color: #01224a;
          padding: 20px;
          border-radius: 10px;
          box-shadow: 0 0 10px rgba(0, 0, 0, 0.1);
          width: calc(30% - 20px);
          margin: 20px;
        }

        .portfolio-card h2 {
          margin-top: 20px;
          color: white;
        }

        .portfolio-card ul {
          list-style: none;
          padding: 0;
          margin: 0;
        }

        .portfolio-card li {
          margin-bottom: 10px;
          color: white;
        }
      `}</style>
    </>
  );
};

export default Portfolio;
